import React, { useState } from "react";
import Axios from "axios";

import Form from "react-bootstrap/Form";
import Button from "react-bootstrap/Button";

export default function Register() {
  const [userNameReg, setUserNameReg] = useState("");
  const [userSurnameReg, setUserSurnameReg] = useState("");
  const [userEmailReg, setUserEmailReg] = useState("");
  const [userPasswordReg, setUserPasswordReg] = useState("");

  const register = () => {
    Axios.post("http://localhost:8000/user", {
      name: userNameReg,
      surname: userSurnameReg,
      email: userEmailReg,
      password: userPasswordReg,
    });
  };

  return (
    <>
      <Form>
        <Form.Group controlId="formBasicEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control
            type="email"
            placeholder="Enter email"
            onChange={(e) => {
              setUserEmailReg(e.event.value);
            }}
          />
          <Form.Label>Name</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter name"
            onChange={(e) => {
              setUserNameReg(e.event.value);
            }}
          />
          <Form.Label>Surname</Form.Label>
          <Form.Control
            type="text"
            placeholder="Enter surname"
            onChange={(e) => {
              setUserSurnameReg(e.event.value);
            }}
          />
        </Form.Group>

        <Form.Group controlId="formBasicPassword">
          <Form.Label>Password</Form.Label>
          <Form.Control
            type="password"
            placeholder="Password"
            onChange={(e) => {
              setUserPasswordReg(e.event.value);
            }}
          />
        </Form.Group>

        <Button variant="primary" onClick={register}>
          Register
        </Button>
        <Button variant="primary" type="submit">
          Login
        </Button>
      </Form>
    </>
  );
}
